import "react-datepicker/dist/react-datepicker.css";
import './SevenPage.scss'
import { useNavigate } from 'react-router-dom';

const SevenPage = () => {
    const navigate = useNavigate();
    return (
        <div className="sevenpage-container">
            <div style={{ fontSize: "20px", fontWeight: "600", paddingLeft: "10px" }}>Education</div>
            <div style={{ paddingLeft: "10px" }}>Does the applicant authorise another person to receive written correspondence on their behalf?</div>
            
            <button onClick={() => navigate('/sevenpage')}>Next</button>
        </div>
    )
}
export default SevenPage;
